import './App.css'
import Calendar from './Components/Calendar';
import Deadline from './Components/Deadline';
import Header from './Components/Header';

function App() {

    return (
        <div className="App">

            <div className='timeline'>
                <Header/>
                <Calendar/>
                <Deadline/>
            </div>
        </div>
    );
}

export default App;
